import Head from 'next/head'
import Navbar from '../components/Navbar'
import { getMinifiedRecord, getMinifiedRecords, table } from './api/utils/Airtable'

export default function Home({ initialTodos ,err}) {
  console.log(initialTodos)
  console.log(err)
  return (
    <div>
      <Head>
        <title>Todo</title>
        <link rel='icon' href='/favicon.ico' />
      </Head>
      <Navbar />
      <main>
        <h1>Hello</h1>
      </main>
    </div>
  )
}

export async function getServerSideProps(context) {
  console.log(process.env.AIRTABLE_API_KEY)
  try {
    const todos = await table.select({}).firstPage()
    return { props: { initialTodos: getMinifiedRecords(todos) } }
  } catch (e) {
    // console.error(e);
    return { props: { err: 'Something went wrong' } }
  }
}
